import React from "react"
import { HashLink as Link } from "react-router-hash-link"

const Navigation = () => {
  return (
    <div className="navigation">
      <Link to="./Hi.accueil">Accueil</Link>
      <Link to="who_am_i">Qui suis-je?</Link>
      <Link to={{pathname:"/portfolio", state:{fromBanner: true}}}>Portfolio</Link>
    </div>
  )
}
export default Navigation
